import Auxiilary from '../../../../hoc/Auxillary'


const sideDrawer = (props) => {

    return (
        <div className={styles.SideDrawer}>
            <div className={styles.Logo}> 
            <Logo />
            </div>
            <nav>
                <NavItems/>
            </nav>
        </div>
    );

}

export default sideDrawer;
